def model(x, y, data):
    from math import sqrt
    if not data:
        return None # Cannot classify with no data
    distances = sorted([(sqrt((x - xi)**2 + (y - yi)**2), label) for xi, yi, label in data])
    k = 5
    # Adjust k if less than k points are available
    actual_k = min(k, len(distances))
    if actual_k == 0:
        return None # No neighbors to compare
    top_k_labels = [label for _, label in distances[:actual_k]]
    count0 = top_k_labels.count(0)
    count1 = top_k_labels.count(1)
    if count1 > count0:
        return 1
    elif count0 > count1:
        return 0
    else:
        # Tie-breaking: return label of the closest neighbor
        return distances[0][1]

