def model(x, y, data):
    import math
    distances = []
    for xi, yi, label in data:
        dist = math.sqrt((x - xi)**2 + (y - yi)**2)
        distances.append((dist, label))

    distances.sort()
    k = 3

    if len(distances) < k:
         k = len(distances)

    if k == 0:
         return 0 # Default if no neighbors

    neighbors = distances[:k]
    neighbor_labels = [label for dist, label in neighbors]

    count0 = neighbor_labels.count(0)
    count1 = neighbor_labels.count(1)

    if count1 > count0:
        return 1
    elif count0 > count1:
         return 0
    else:
         # Tie-breaking: return the class of the nearest neighbor
         if k > 0:
             return neighbors[0][1]
         else:
             return 0

